import requests
from bs4 import BeautifulSoup

def get_pokemon_list(markup, save_to_file=False):
    soup = BeautifulSoup(markup, 'html.parser')
    pokemon_list = soup.find_all('div', class_='infocard')
    dex = []
    for i, pokemon in enumerate(pokemon_list):
        name = pokemon.find('a', class_='ent-name').text
        url = pokemon.find('img', class_='img-sprite')['src']
        key = url.split('/')[-1]
        no = i + 1

        if save_to_file:
            with open(f'./out/pokemon/{name}.png', 'wb') as f:
                f.write(requests.get(url).content)

        # dex[key] = {
        #     'name': name,
        #     'no': no,
        # }
        dex.append(name)

    print(dex)


